// frontend/src/pages/UserDashboard.jsx

import React from 'react';
import StatCard from '@/components/StatCard';
import PieChart from '@/components/charts/PieChart';
import LineChart from '@/components/charts/LineChart';

const UserDashboard = () => {
  return (
    <div id="view-dashboard" className="tab-content p-6">
      <div className="md:flex md:items-center md:justify-between mb-8">
        <h1 className="text-3xl font-bold text-gray-900">Welcome back, Alex!</h1>
      </div>

      <div className="grid grid-cols-1 gap-5 sm:grid-cols-2 lg:grid-cols-4 mb-8">
        <StatCard title="Campaigns Running" value="2" color="indigo" icon="PlayIcon" />
        <StatCard title="Success Rate" value="92%" color="green" icon="CheckIcon" />
        <StatCard title="Submissions (Month)" value="1,482" color="blue" icon="MailIcon" />
        <StatCard title="Submissions Left" value="3,518" color="yellow" icon="ClockIcon" />
      </div>

      <div className="grid grid-cols-1 lg:grid-cols-3 gap-8">
        <div className="lg:col-span-1 bg-white p-6 rounded-lg shadow">
          <h3 className="text-lg font-semibold text-gray-900 mb-4">Submission Status</h3>
          <div className="h-64 flex items-center justify-center">
            <PieChart />
          </div>
        </div>
        <div className="lg:col-span-2 bg-white p-6 rounded-lg shadow">
          <h3 className="text-lg font-semibold text-gray-900 mb-4">Weekly Activity</h3>
          <div className="h-64">
            <LineChart />
          </div>
        </div>
      </div>
    </div>
  );
};

export default UserDashboard;
